import React from 'react';

function Food({ fav })  {
  return <h1>I like {fav}</h1>;
}

function App() {
  return (
  <div>
    <h1>
    Hello!! React!!
    <Food fav="kimchi" /> 
    </h1>
  </div>
  )
}

export default App;
